import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Register from "./Register";
import ProfilePage from "./ProfilePage";
import Login from "./Login";
import Post_main from "./post_main";


export default function App() {
    return (
        <Router>
            <div class="container">
                <header class="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 mb-4 border-bottom">
                    <a href="" class="d-flex align-items-center col-md-3 mb-2 mb-md-0 text-dark text-decoration-none">

                    </a>

                    <ul class="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
                        <li><a href="/" class="nav-link px-2 link-secondary">Home</a></li>
                        <li><a href="#" class="nav-link px-2 link-dark">About</a></li>
                    </ul>

                    <div class="col-md-3 text-end">
                        <Link to={'/login'} component={Register}><button type="button" class="btn btn-outline-primary me-2">Login</button></Link>
                        <Link to={'/register'} component={Login}><input type="button" class="btn btn-primary" value='Sign up' /></Link>
                    </div>

                </header>
                <div>
                    <h2 class="display-2">Hello, adventurer</h2>
                    <h3 class="text-muted ml-3">Welcome to my site, here you can ask for help others and help someone too</h3>
                </div>
                <div>
                    <img class="w-100" src="https://cutewallpaper.org/21/anime-gif-wallpaper-1920x1080/Pin-on-nim-gif.gif"></img>
                    <h5 class="display-7 ml-3 text-danger" style={{ float: "right" }}>Be kind and helpful</h5>
                </div>
            </div>
            <Switch>
                {/* <Route path='/register' component={Register} /> */}
                <Route path='/main' component={ProfilePage} />
                <Route path='/post_main' component={Post_main} />
                {/* <Route path='/login' component={Login} /> */}
            </Switch>

        </Router>

    );
}
